import React, { useState } from 'react';
import './App.css';

export default function App() {

  const [numbers, setNumbers] = useState[1, 2, 3, 4, 5];
  const listItems = numbers.map((number) => {
    <li>{number}</li>
  }) 

  return (
    <div>
      <h1>Lista de tarefas</h1>
      <button>Enviar</button>
      <ul>{listItems}</ul>
    </div>
  );
}
